import React from "react";
import {Button} from 'antd';

const Employee = ({coordinate, id, removeItem}) => {

    const removeEmployee = () => {
        removeItem(id)
    }

    var options = {
        era: 'long',
        year: 'numeric',
        month: 'long',
        day: 'numeric',
        weekday: 'long',
        timezone: 'UTC',
        hour: 'numeric',
        minute: 'numeric',
        second: 'numeric'
    };

    return <div>
        <div>
            <span>
                            <div>Latitude: {coordinate.latitude}</div>
                            <div>Longitude:{coordinate.longitude}</div>
                            <div>Date: {coordinate.date.toLocaleString("ru", options)}</div>


                        </span>

        </div>

        <Button danger onClick={removeEmployee}>Delete</Button>

    </div>
}

export default Employee;
